import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    paddingVertical: 60,
    paddingHorizontal: 80,
    width: "100%",
    flexWrap: "wrap",
  },
  header: {
    marginBottom: 60,
  },
  sectionRow: {
    flexDirection: "row",
    marginBottom: 80,
  },
  section: {
    marginRight: 120,
  },
  sectionTitle: {
    marginBottom: 30,
  },
  sectionSubTitle: {
    marginBottom: 30,
  },
  columns: {
    flexDirection: "row",
  },
  column: {
    marginRight: 120,
  },
  components: {
    alignItems: "flex-start",
  },
  component: {
    marginBottom: 40,
  },
});

export default styles;
